// src/pages/Registration.js
import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import logo1298 from "../assets/logo1298.svg";

function Registration() {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const navigate = useNavigate();
    const [fullName, setFullName] = useState('');
    const [numberPhone, setNumberPhone] = useState('');
    async function registerUser(email, password, fullName, numberPhone) {
        try {
            const response = await axios.post('http://91.77.160.177:4001/register', {
                email,
                password,
                fullName,
                numberPhone
            });
            console.log('Успешная регистрация:', response.data);
            return response.data; // Возвращаем ответ для дальнейшей обработки
        } catch (error) {
            if (error.response) {
                console.error('Ошибка регистрации:', error.response.data.message);
            } else if (error.request) {
                console.error('Ошибка: ответ от сервера не получен', error.request);
            } else {
                console.error('Ошибка:', error.message);
            }
            throw error; // Можно выбросить ошибку дальше для обработки в родительском компоненте
        }
    }

    const handleRegister = async (e) => {
        e.preventDefault();

        try {
            const result = await registerUser(email, password, fullName, numberPhone);
            navigate('/'); // Перенаправление после успешной регистрации
            console.log(result); // Успешная регистрация
        } catch (error) {
            console.error('Не удалось зарегистрироваться', error);
        }
    };

    return (
        <div className="login-container" style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
            <img src={logo1298} className="logo" alt="logo" style={{ width: '200px' }} />
            <h2>Классный помощник <br />Школа №1298</h2>
            <h3>Регистрация</h3>
            <form onSubmit={handleRegister}>
                <div className="input-group">
                    <label htmlFor="email">E-mail:</label>
                    <input
                        type="email"
                        id="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        required
                        style={{width: '300px'}}
                    />
                </div>
                <div className="input-group">
                    <label htmlFor="fio">Фамилия Имя:</label>
                    <input
                        type="text"
                        id="fio"
                        value={fullName}
                        onChange={(e) => setFullName(e.target.value)}
                        required
                        style={{width: '300px'}}
                    />
                </div>
                <div className="input-group">
                    <label htmlFor="nph">Номер телефона:</label>
                    <input
                        type="nph"
                        id="nph"
                        value={numberPhone}
                        onChange={(e) => setNumberPhone(e.target.value)}
                        required
                        style={{width: '300px'}}
                    />
                </div>
                <div className="input-group">
                    <label htmlFor="password">Пароль:</label>
                    <input
                        type="password"
                        id="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        required
                        style={{width: '300px'}}
                    />
                </div>
                <div className="button-group">
                    <button type="submit" style={{width: 'max-content', marginBottom: '20px'}}>Зарегистрироваться
                    </button>
                </div>
                <span onClick={() => navigate('/')} style={{
                    textAlign: 'center',
                    color: 'white',
                    marginTop: '20px',
                    textDecoration: 'underline'
                }}>Войти</span>
            </form>
        </div>
    );
}

export default Registration;
